import React, { Component } from 'react';
import { Jumbotron, Button } from 'reactstrap';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Jumbotron>
          <h1 className="display-3">Hello World</h1>
          <p className="lead">This is my website. What up?</p>
        </Jumbotron>
      </div>
    );
  }
}

export default App;
